import { useState, useEffect } from "react";
import Layout from "../layout";

function Cart() {
  const [product, setProduct] = useState([]);
  useEffect((_) => {
    const cart = JSON.parse(sessionStorage.getItem("cart"));
    cart && cart.map((item) => setProduct((prev) => [...prev, item.product]));
  }, []);

  return (
    <Layout>
      <div className="w-3/5 pt-10 m-auto">
        <div className="flex justify-between">
          <div>
            <h3 className="font-medium text-lg text-gray-700 mb-5">Bag</h3>
            {product &&
              product.map((prod) => (
                <>
                  <img src={prod.image} />
                  <h4>{prod.name}</h4>
                </>
              ))}
          </div>
          <div>
            <h3 className="font-medium text-lg text-gray-700 mb-5">Summary</h3>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default Cart;
